import React from "react";
import { motion } from "framer-motion";

const Box = {
  initial: {
    height: "100vh",
    bottom: 0,
  },
  animate: {
    height: 0,
    transition: {
      when: "afterChildren",
      duration: 1.5,
      ease: [0.8, 0, 0.15, 1],
    },
    exit: { opacity: 0 },
  },
};
function BlackTransition() {
  return (
    <div
      className="absolute inset-0 flex
  items-center justify-center"
    >
      <motion.div
        className="BlackTransition-box relative z-50 w-full bg-black"
        initial="initial"
        animate="animate"
        exit="exit"
        variants={Box}
      ></motion.div>
    </div>
  );
}

export default BlackTransition;
